import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import ResumeBuilder from './ResumeBuilder';

const App = () => {
  return (
    <div>
      <h1>Resume Builder App</h1>
      <Router>
        <Route exact path="/Resume" component={ResumeBuilder} />
      </Router>
    </div>
  );
};

export default App;
